// components/MediaForm.js
import React, { useState, useEffect } from 'react';
import '../static/MediaFormStyle.css';

function MediaForm({ mediaItem, onSave, prefillData }) {
    const [name, setName] = useState(prefillData ? prefillData.name : '');
    const [type, setType] = useState(prefillData ? prefillData.type : '');
    const [status, setStatus] = useState('watching');
    const [episodesWatched, setEpisodesWatched] = useState(0);
    const [rating, setRating] = useState(0);
    const [review, setReview] = useState('');

    useEffect(() => {
        if (mediaItem) {
            setName(mediaItem.name);
            setType(mediaItem.type);
            setStatus(mediaItem.status);
            setEpisodesWatched(mediaItem.episodes_watched);
            setRating(mediaItem.rating);
            setReview(mediaItem.review);
        }
    }, [mediaItem]);

    const handleSubmit = (e) => {
        e.preventDefault();
        const newMedia = {
            id: mediaItem ? mediaItem.id : undefined,
            name,
            type,
            status,
            episodes_watched: episodesWatched,
            rating,
            review,
        };

        onSave(newMedia);

        if (!mediaItem) {
            setName(prefillData ? prefillData.name : '');
            setType(prefillData ? prefillData.type : '');
            setStatus('watching');
            setEpisodesWatched(0);
            setRating(0);
            setReview('');
        }
    };

    return (
        <div className="media-form-container">
            <h2 className="media-form-title">{mediaItem ? 'Edit Media' : 'Add Media to Your List'}</h2>
            <form className="media-form" onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Name:</label>
                    <input
                        type="text"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        readOnly={prefillData && prefillData.name ? true : false}
                    />
                </div>
                <div className="form-group">
                    <label>Type:</label>
                    <input
                        type="text"
                        value={type}
                        onChange={(e) => setType(e.target.value)}
                        readOnly={prefillData && prefillData.type ? true : false}
                    />
                </div>
                <div className="form-group">
                    <label>Status:</label>
                    <select value={status} onChange={(e) => setStatus(e.target.value)}>
                        <option value="watching">Watching</option>
                        <option value="completed">Completed</option>
                        <option value="dropped">Dropped</option>
                    </select>
                </div>
                <div className="form-group">
                    <label>Episodes Watched:</label>
                    <input
                        type="number"
                        value={episodesWatched}
                        onChange={(e) => setEpisodesWatched(e.target.value)}
                    />
                </div>
                <div className="form-group">
                    <label>Rating:</label>
                    <div className="rating-container">
                        <input
                            type="number"
                            value={rating}
                            min="0"
                            max="10"
                            onChange={(e) => setRating(e.target.value)}
                            className="rating-input"
                        />
                        <span className="rating-text">/ 10</span>
                    </div>
                </div>
                <div className="form-group">
                    <label>Review:</label>
                    <textarea value={review} onChange={(e) => setReview(e.target.value)} />
                </div>
                <button className="submit-button" type="submit">
                    {mediaItem ? 'Save Changes' : 'Add to List'}
                </button>
            </form>
        </div>
    );
}

export default MediaForm;
